import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import PaperComponent3 from "../components/Paper3";
import Pic from "../img/geburtsvorbereitung-details.jpg";

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    '& > *': {
      width: '80%',
      margin: '3% auto 5% auto',
      color: '#383e56',
      height: 'auto',
      padding: '3em',
    },
  },
}));

export default function Paper3() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <Paper
        elevation={3}
        children={
          <div>
            <div>
              <div className="row">
                <div className="col-8 paper-text-style">
                  <h1 className="paper-header">Geburtsvorbereitungskurs</h1>
                  <hr className="hr-duck" />
                  <p>
                  Bei einem privaten Geburtsvorbereitungskurs, alleine oder mit deinem Partner/deiner Partnerin können wir gezielt auf deine Fragen eingehen.
                  </p>
                  <p>
                    Wir besprechen Themen wie die letzten Wochen der Schwangerschaft, Geburt, Wochenbett und Stillbeginn.
                  </p>
                  <p>
                    Auch Wehen- und Atemübungen und Unterstützungsmöglichkeiten von Seitens des Partners finden hier Platz.
                  </p>
                  <h3>
                    Kosten: 240 Euro
                  </h3>
                </div>
                <div className="col-4 paper-col-img-style">
                  <img src={Pic} alt="Probe" className="paper-img-style"/>
                </div>
              </div>
            </div>
          </div>
        }
      />
    </div>
  );
}
